import osimport face_recognitiontarget_path = os.path.join(os.getcwd(), 'storage/images')def compare_face(image):    unknown_image_path = os.path.join(os.getcwd(), image)    unknown_face = face_recognition.load_image_file(unknown_image_path)    unknown_face_encodings = face_recognition.face_encodings(unknown_face)    os.remove(unknown_image_path)    if len(unknown_face_encodings) == 0:        return None    else:        unknown_face_encoding = unknown_face_encodings[0]    known_faces    = []    known_face_ids = []    results        = []    matched_faces  = []    for file in os.listdir(target_path):        if file.endswith('.jpg') or file.endswith('.png'):            known_faces.append(os.path.join(target_path, file))            known_face_ids.append(file.split('.')[0])    for known_face_path in known_faces:        known_image = face_recognition.load_image_file(known_face_path)        known_image_encodings = face_recognition.face_encodings(known_image)        if len(known_image_encodings) == 0:            results.append(False)            continue        result = face_recognition.compare_faces(known_image_encodings, unknown_face_encoding)        results.append(result[0])    for i in range(len(results)):        if results[i]:            matched_faces.append(known_face_ids[i])    return matched_faces